) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='SELECT COLUMN_NAME \r\nFROM INFORMATION_SCHEMA.COLUMNS \r\nWHERE TABLE_NAME = ''pro_cad_origem'';\r\n\r\nSELECT TABLE_SCHEMA, TABLE_NAME, COLUMN_NAME, DATA_TYPE \r\nFROM INFORMATION_SCHEMA.COLUMNS \r\nWHERE TABLE_SCHEMA = ''SGC'';\r\n';

INSERT INTO `pro_cad_origem` (`id`, `form_on`, `descricao`, `informação`, `created_by`, `created_by_name`, `updated_by`, `updated_by_name`, `created_at`, `updated_at`, `deleted_at`) VALUES
	(1, 'Y', 'Órgão Federal', 'No topo da hierarquia, o Governo Federal é responsável por questões de interesse nacional.', '0', 'unknown', '0', 'unknown', '2025-03-08 12:25:00', '2025-03-10 12:19:15', NULL),
	(2, 'Y', 'Órgão Estadual', 'Os governos estaduais atuam como intermediários entre a União e os municípios, com responsabilidades específicas em seus territórios.', '0', 'unknown', '0', 'unknown', '2025-03-08 12:25:00', '2025-03-10 12:19:57', NULL),
	(3, 'Y', 'Órgão Municipal', 'As prefeituras são responsáveis pela execução direta dos serviços públicos no âmbito local.', '0', 'unknown', '0', 'unknown', '2025-03-08 12:25:00', '2025-03-10 12:23:19', NULL),
	(4, 'Y', 'Empresa Privada', 'Organização com fins lucrativos.', '0', 'unknown', '0', 'unknown', '2025-03-08 12:25:00', '2025-03-10 12:23:19', NULL),
	(5, 'Y', 'Funcionário de Empresa Privada', 'Pessoa contratada por uma empresa não governamental.', '0', 'unknown', '0', 'unknown', '2025-03-08 12:25:00', '2025-03-10 12:23:19', NULL),
	(6, 'Y', 'Funcionário Público Estadual', 'servidor pago pelo estado para executar serviços públicos específicos, como educação, saúde e segurança.', '0', 'unknown', '0', 'unknown', '2025-03-08 12:25:00', '2025-03-10 12:23:19', NULL),
	(7, 'Y', 'Poder Executivo Federal', 'Predidente e seus ministros.', '0', 'unknown', '0', 'unknown', '2025-03-08 12:25:00', '2025-03-10 12:23:19', NULL),
	(8, 'Y', 'Poder Executivo Estadual', 'Governadores e seus secretários. ', '0', 'unknown', '0', 'unknown', '2025-03-08 12:25:00', '2025-03-10 12:23:19', NULL),
	(9, 'Y', 'Poder Executivo Municipal', 'Prefeitos e seus secretários.', '0', 'unknown', '0', 'unknown', '2025-03-08 12:25:00', '2025-03-10 12:23:19', NULL),
	(10, 'Y', 'Administração Pública Direta', 'Compreende os órgãos diretamente ligados aos chefes dos poderes Executivo, Legislativo e Judiciário (ex: ministérios, secretarias).', '0', 'unknown', '0', 'unknown', '2025-03-08 12:25:00', '2025-03-10 12:23:19', NULL),
	(11, 'Y', 'Administração Pública Indireta', 'Inclui entidades com personalidade jurídica própria, mas vinculadas à administração direta', '0', 'unknown', '0', 'unknown', '2025-03-08 12:25:00', '2025-03-10 12:23:19', NULL),
	(12, 'Y', 'Autarquia', 'Entidades com autonomia administrativa, financeira e patrimonial, criadas por lei para desempenhar atividades típicas do Estado (ex: INSS, Banco Central).', '0', 'unknown', '0', 'unknown', '2025-03-08 12:25:00', '2025-03-10 12:23:19', NULL),
	(13, 'Y', 'Fundaçõe Pública', 'Entidades com patrimônio próprio e finalidade específica, como cultura, ensino ou pesquisa (ex: Fiocruz, IBGE).', '0', 'unknown', '0', 'unknown', '2025-03-08 12:25:00', '2025-03-10 12:23:19', NULL),
	(14, 'Y', 'Empresa Pública', 'Entidades com capital majoritariamente público, que exploram atividade econômica (ex: Caixa Econômica Federal, Correios).', '0', 'unknown', '0', 'unknown', '2025-03-08 12:25:00', '2025-03-10 12:23:19', NULL),
	(15, 'Y', 'Sociedade de Economia Mista', 'Entidades com capital público e privado, que exploram atividade econômica (ex: Banco do Brasil, Petrobras).', '0', 'unknown', '0', 'unknown', '2025-03-08 12:25:00', '2025-03-10 12:23:19', NULL),
	(16, 'Y', 'Órgãos Vinculados', 'Entidades que mantêm relação de subordinação ou supervisão com outros órgãos ou entidades da administração pública.', '0', 'unknown', '0', 'unknown', '2025-03-08 12:25:00', '2025-03-10 12:23:19', NULL),
	(17, 'Y', 'Entidade de Controle', 'Órgãos responsáveis pela fiscalização e controle da administração pública (ex: Tribunal de Contas da União, Controladoria-Geral da União).', '0', 'unknown', '0', 'unknown', '2025-03-08 12:25:00', '2025-03-10 12:23:19', NULL),
	(18, 'Y', 'Ministério Público', 'Instituição autônoma com a função de defender a ordem jurídica, o regime democrático e os interesses sociais e individuais indisponíveis.', '0', 'unknown', '0', 'unknown', '2025-03-08 12:25:00', '2025-03-10 12:23:19', NULL),
	(19, 'Y', 'Poder Judiciário ', 'Garantir o cumprimento da Constituição Federal. ', '0', 'unknown', '0', 'unknown', '2025-03-08 12:25:00', '2025-03-10 12:23:19', NULL),
	(20, 'Y', 'Supremo Tribunal Federal (STF)', 'Julgar processos judiciais, Interpretar as leis, Garantir os direitos individuais e coletivos, assegurar o cumprimento da constituição.', '0', 'unknown', '0', 'unknown', '2025-03-08 12:25:00', '2025-03-10 12:23:19', NULL),
	(21, 'Y', 'Superior Tribunal de Justiça (STJ)', 'Julgar processos judiciais, Interpretar as leis, Garantir os direitos individuais e coletivos, assegurar o cumprimento da constituição.', '0', 'unknown', '0', 'unknown', '2025-03-08 12:25:00', '2025-03-10 12:23:19', NULL),
	(22, 'Y', 'Tribunais Regionais Federais (TRFs). ', 'Julgar processos judiciais, Interpretar as leis, Garantir os direitos individuais e coletivos, assegurar o cumprimento da constituição.', '0', 'unknown', '0', 'unknown', '2025-03-08 12:25:00', '2025-03-10 12:23:19', NULL),
