	(24, 'Y', 'Poder Legislativo', 'Fiscalizar o Poder Executivo e representar os interesses da população. ', '0', 'unknown', '0', 'unknown', '2025-03-08 12:25:00', '2025-03-10 12:23:19', NULL),
	(25, 'Y', 'Congresso Nacional', 'Câmara dos Deputados e Senado Federal.', '0', 'unknown', '0', 'unknown', '2025-03-08 12:25:00', '2025-03-10 12:23:19', NULL),
