CREATE TABLE IF NOT EXISTS `pro_circuito` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `cadastro_prestadora_id` bigint unsigned DEFAULT NULL,
  `cadastro_cliente_id` bigint unsigned DEFAULT NULL,
  `velocidade_id` bigint unsigned DEFAULT NULL,
  `endereco_id` bigint unsigned DEFAULT NULL,
  `sigla` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `status` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `active` enum('Y','N') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `nome` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `data_ativacao` date DEFAULT NULL,
  `data_cancelamento` date DEFAULT NULL,
  `sei` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `operacao` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_by` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_by_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `updated_by` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `updated_by_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_at` datetime DEFAULT (now()),
  `updated_at` datetime DEFAULT (now()) ON UPDATE CURRENT_TIMESTAMP,
  `deleted_at` datetime DEFAULT NULL,
  `novo_cadastro_prestadora_id` int DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  KEY `circuito_velocidade_id_index` (`velocidade_id`) USING BTREE,
  KEY `endereco_id` (`endereco_id`),
  KEY `circuito_setor_id_index` (`cadastro_cliente_id`) USING BTREE,
  KEY `cadastro_prestadora_id` (`cadastro_prestadora_id`),
  CONSTRAINT `FK_pro_circuito_pro_cadastro` FOREIGN KEY (`cadastro_cliente_id`) REFERENCES `pro_cadastro` (`id`) ON DELETE SET NULL ON UPDATE SET NULL,
  CONSTRAINT `FK_pro_circuito_pro_cadastro_2` FOREIGN KEY (`cadastro_prestadora_id`) REFERENCES `pro_cadastro` (`id`) ON DELETE SET NULL ON UPDATE SET NULL,
  CONSTRAINT `FK_pro_circuito_pro_circuito` FOREIGN KEY (`endereco_id`) REFERENCES `pro_circuito` (`id`) ON DELETE SET NULL ON UPDATE SET NULL,
  CONSTRAINT `FK_pro_circuito_pro_velocidade` FOREIGN KEY (`velocidade_id`) REFERENCES `pro_velocidade` (`id`) ON DELETE SET NULL ON UPDATE SET NULL
) ENGINE=InnoDB AUTO_INCREMENT=62 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='SELECT COLUMN_NAME \r\nFROM INFORMATION_SCHEMA.COLUMNS \r\nWHERE TABLE_NAME = ''pro_circuito'';\r\n\r\nSELECT TABLE_SCHEMA, TABLE_NAME, COLUMN_NAME, DATA_TYPE \r\nFROM INFORMATION_SCHEMA.COLUMNS \r\nWHERE TABLE_SCHEMA = ''SGC'';\r\n';

